import React from 'react';
import { Dropdown } from 'semantic-ui-react'
import faker from 'faker'

class PlayerSelector extends React.Component {
	constructor(props) {
		super(props)
	}

	render() {
		const lst = [{key:1, text:'hello', value:'world'}]
		return (
			<Dropdown
			placeholder='Player'
			fluid
			multiple
			search
			options={lst}
			/>
		)
	}
}

export default PlayerSelector;
